INSERT INTO `weixin_newsitem` (`ID`, `new_type`, `author`, `content`, `description`, `imagepath`, `orders`, `title`, `templateid`, `url`, `create_date`, `accountid`) VALUES ('4028d881472f356e01472f36d0a00003',NULL,'Jeecg','<h2 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 24px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); white-space: normal; background-color: rgb(250, 250, 250);\">一、简介</h2><p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 1.33; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal; background-color: rgb(250, 250, 250);\">jeewx是一个开源，高效，敏捷的微信开发平台采用JAVA语言，它是基于jeecg这个企业级快速开发框架实现的。 jeewx的目的是最大化的简化微信开发的流程，使用开发者能把最好的精力放到微信具体业务开发，并能以最快的时间完成。把一些常规而频繁的工作交由jeewx来处理即可，平台兼备的代码生成器，在线开发，可以快速的完成企业应用。为此jeewx提供了详细的二次开发文档，关键代码里还是相关的注释说明。jeewx采用插件的方式实现微信功能，不同的插件实现不同的微信功能。</p><h2 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 24px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"主要特性\" href=\"http://git.oschina.net/jeecg/jeewx#主要特性\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; background-position: initial initial; background-repeat: initial initial;\"></a>主要特性</h2><ul class=\"task-list list-paddingleft-2\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin-bottom: 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li><p>1、基于快速开发平台jeecg 3.4.4最新版本，采用SpringMVC+Hibernate4+UI库+代码生成器+Jquery+Ehcache等主流架构技术</p></li><li><p>2、支持企业快速开发，完善的用户组织机构，报表，强大的代码生成器快速有效的提高开发效率</p></li><li><p>3、开源免费，jeewx遵循Apache2开源协议,免费提供使用。</p></li><li><p>4、支持多用户多公众号管理</p></li><li><p>5、详细的二次开发文档，并不断更新增加相关开发案例提供学习参考</p></li><li><p>6、微信功能插件化开发，更易于定制和二次开发</p></li><li><p>7、提供丰富的微信插件下载安装使用，总有一些是符合或接近你的需求</p></li></ul><h2 style=\"box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; margin: 20px 0px 10px; padding: 0px; font-size: 24px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); white-space: normal; background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"主要功能\" href=\"http://git.oschina.net/jeecg/jeewx#主要功能\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); text-decoration: none; background-color: transparent; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; background-position: initial initial; background-repeat: initial initial;\"></a>主要功能</h2><ul class=\"task-list list-paddingleft-2\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin-bottom: 15px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(250, 250, 250);\"><li><p>1，微信接口认证</p></li><li><p>2，菜单自定义</p></li><li><p>3，文本管理和回复</p></li><li><p>4，关注欢迎语</p></li><li><p>5，关键字管理</p></li><li><p>6，文本模板管理</p></li><li><p>7，图文模板管理</p></li><li><p>8，账号管理</p></li><li><p>9，用户管理</p></li><li><p>10，角色管理</p></li><li><p>11，菜单管理</p></li><li><p>12, 微信支持多用户多公众号</p></li><li><p>13，微信大转盘</p></li><li><p>14，微信刮刮乐</p></li><li><p>15，微信CMS</p></li><li><p>16，自定义接口回复</p></li><li><p>17，翻译</p></li><li><p>18，天气 更多功能参考官方：www.jeecg.org</p></li></ul><p><br/></p>','Jeewx管家介绍','upload/files/20151201175716Q7tIXj7S.jpg','1','Jeewx管家介绍','4028d881472f356e01472f36461b0001','','2014-07-13','402881e8461795c201461795c2e90000');
