INSERT INTO `weixin_texttemplate` (`ID`, `addtime`, `content`, `templatename`, `accountid`) VALUES ('f7a8a3a946e249c20146e25c4dc7000c','2014-06-28 20:03:58',' 欢迎您关注JEEWX管家，捷微是一款基于JAVA语言的，多触点管理系统，支持微信公众号、微信企业号、支付服务窗，同时代码完全开源，方便二次开发。程序自身提供部分行业解决方案及丰富的营销功能。更多演示功能请查看下方菜单。\r\n官网：www.jeewx.com\r\nQQ群：289709451\r\n论坛：www.jeecg.org','欢迎关注语','402881e8461795c201461795c2e90000');
INSERT INTO `weixin_texttemplate` (`ID`, `addtime`, `content`, `templatename`, `accountid`) VALUES ('f7a8a3a946e55a940146e5a3e498004d','2014-06-29 11:21:01','微译使用指南\r\n\r\n微译为用户提供专业的多语言翻译服务，目前支持以下翻译方向：\r\n    中 -> 英\r\n    英 -> 中\r\n    日 -> 中\r\n\r\n使用示例：\r\n    翻译我是中国人\r\n    翻译dream\r\n    翻译さようなら\r\n\r\n回复“?”显示主菜单','微译使用指南','402881e8461795c201461795c2e90000');
