  `subscribe_time` int(11) NOT NULL COMMENT '用户关注时间，为时间戳。如果用户曾多次关注，则取最后关注时间',
  `unionid` varchar(30) DEFAULT NULL COMMENT '只有在用户将公众号绑定到微信开放平台帐号后，才会出现该字段。',
  `remark` varchar(255) DEFAULT NULL COMMENT '公众号运营者对粉丝的备注，公众号运营者可在微信公众平台用户管理界面对粉丝添加备注',
  `groupid` int(11) NOT NULL COMMENT '用户所在的分组ID（兼容旧的用户分组接口）',
  `isblack` int(11) DEFAULT '0' COMMENT '用户是否被拉黑',
  PRIMARY KEY (`accountid`,`openid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户信息表';
